import React, {Component} from 'react';

class WorkSpace extends Component {

    state={height:'1000px'};

    render() {
        return (
            <div style={{minWidth:'1680px',minHeight:'1000px',height:this.state.height,border:'solid 1px gray',float:'left',marginLeft:'10px',marginTop:'10px'}}>

            </div>
        );
    }
}

export default WorkSpace;
